import React from "react";
import "./App.css";

function Profile(props) {

  return (
    <div>
      <h2>Profile</h2>
      <p>My name is Ludvig.</p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Hello Ludvig!</h2>
      </header>
    </div>
  );
}

export default App;
